import React from "react";

import { capitalize } from "../../../Utils";
import "./index.scss";

export const Desciptor = ({ name, value, icon }) => (
  <div className="user-descriptor-container">
    <div className="descriptor-icon-container">
      <object data={icon} type="image/svg+xml">
        <img alt="descriptor" src={icon} />
      </object>
    </div>
    <div className="descriptor-info-container box">
      <label className="descriptor-name">{capitalize(name)}</label>
      <label className="descriptor-value">{value}</label>
    </div>
  </div>
);
